import React from 'react'
import "./ButtonBuy.scss"

const ButtonForBuy = (props) => {
    return (
        <div className="wrap">
            <button onClick={() => {props.Name(this.props.Name)} } className="ButtonBuy">Купить</button>
        </div>
    )
}

export default ButtonForBuy;
